import React from 'react';
import './App.css';
import Button from 'react-bootstrap/Button';

function Nav(){
return  (
    <nav>
        
        <ul className>
        <Button variant="primary">Home</Button>{' '}
        <Button variant="primary">Tabela</Button>{' '}
        </ul>




    </nav>
    )
}

export default Nav;
